        <div className='row'>
            <div className=" cols p-3 bg-info bg-opacity-10 border border-info border-start-0 rounded-end  " >
                <div className="card-body">
                    <h5 className="">{note.Title}</h5>
                    <p className="card-text">{note.Description}</p>
                </div>
            </div>

        </div>
    )
}
